import React from 'react';

const AboutMe = () => {
  return (
    <div>
      <h2>Про мене</h2>
      <p>Я студент, що вчиться на факультеті інформаційних технологій, на навчальній програмі технології цифрового розвитку<b>(ТЦР)</b>, і це мій персональний сайт для відображення моїх робіт.</p>
    </div>
  );
};

export default AboutMe;
